# Complete the substrCount function below.
def special_string(sub_string):
    sub_str_len = len(sub_string)
    temp_dict = dict()
    for i in range(sub_str_len):
        temp_dict[sub_string[i]] = temp_dict.get(sub_string[i], 0) + 1
        
    temp_keys = list(temp_dict.keys())
    # print(sub_string, temp_dict)
    
    if len(temp_keys) == 1:
        # print("IF")
        # print(sub_string)
        return True
    elif len(temp_keys) == 2:
        # print("ELIF")
        key1_occurrences = temp_dict[temp_keys[0]]
        key2_occurrences = temp_dict[temp_keys[1]]
        if (key1_occurrences == 1) and (key2_occurrences == 1):
            # print("ELIF IF1")
            return False
        elif temp_dict[temp_keys[0]] == 1:
            # print("ELIF ELIF1")
            diff_key = temp_keys[0]
        elif temp_dict[temp_keys[1]] == 1:
            # print("ELIF ELIF2")
            diff_key = temp_keys[1]
            # print(diff_key, sub_string[sub_str_len//2])

        if (sub_str_len % 2 == 1) and (sub_string[sub_str_len//2] == diff_key):
            # print("ELIF IF2")
            # print(sub_string)
            return True
        # print("ELIF ELSE")
        return False
    # print("ELSE")
    return False

def substrCount(n, s):
    result = n
    for i in range(n-1):
        for j in range(i+1, n):
            if special_string(sub_string=s[i:j+1]):
                result += 1
    return result
                
        
